import React from "react";
import { Container, Col, Row } from "reactstrap";
import "../assets/css/Navbar.css";

import SearchImg from '../assets/imgs/search.png';
import EarthImg from "../assets/imgs/earth.png";
import UserImg from '../assets/imgs/user.png';
import CartImg from '../assets/imgs/cart.png';

export default function Navbar() {
    return (
        <Container fluid style={{ maxHeight: "66px" }}>
            <Row className='nav-container'>
                <Col xl={4} className='nav-logo'>
                    <span>Doba</span>
                </Col>
                <Col xl={4} className='nav-content'>
                    <span>About us</span>
                    <span>Women</span>
                    <span>Men</span>
                    <span>Beauty</span>
                    <span>Accessories</span>
                    <span>Blog</span>
                    <span>Contact</span>
                </Col>
                <Col xl={4} className="nav-right">
                    <img src={SearchImg}/>
                    <img src={EarthImg}/>
                    <img src={UserImg}/>
                    <img src={CartImg}/>
                </Col>
            </Row>
        </Container>
    );
}
